import React from "react";
import CountButton from "./CountButton/CountButton";
import SearchBar from "./SearchBar/SearchBar";

const products = [
  "tooth paste",
  "tooth brush",
  "mouth wash",
  "mouth guard",
  "dental floss",
];

const App = () => {
  return (
    <div>
      <SearchBar products={products} />
    </div>
  );
};

export default App;
